<template>
    <v-main>
      <div class="containery">
            <div class="login-containerX">
            <div class="register">
                <h2>Inicio de Sesión</h2>
                <form action="">
                <v-text-field v-model="usuario" autofocus
                    label="Usuario"
                    prepend-icon="people_alt"
                ></v-text-field>

                <br>
                <v-text-field  :append-icon="show1 ? 'visibility' : 'visibility_off'"   :type="show1  ? 'text' : 'password'"  @click:append="show1 = !show1" v-model="password" color="accent"  required  @keydown.enter="ingresar"
                    label="Contraseña"
                    prepend-icon="lock"
                ></v-text-field>

                <v-btn block elevation="2" content="Iniciar seción" v-tippy='{ placement : "bottom" }'  @click="ingresar" large color="primary">Ingresar</v-btn>
                </form>
            </div>
            <div class="login">
                <img  content="EMPROVISA" v-tippy='{ placement : "bottom" }' src="data:image/png;base64," alt="">
            </div>
            </div>
        </div>

            <!-- PANTALLA DE CARGA-->
           <PantallaCarga :activo="carga" @escucharResultPantalla="resultPantalla()"> </PantallaCarga>
             <!-- DIALOGO DE ERROR-->
           <Mensaje :activo="activarError" :msj="msjError" :tipo="tipoMsj" @escucharResultMsj="resultMsj()"> </Mensaje>
    </v-main>


</template>
<script>
import axios from 'axios'
import Secion from '@/components/Reutilizable/Secion_vencida'
import Mensaje from '@/components/Reutilizable/Mensaje';
import PantallaCarga from '@/components/Reutilizable/PantallaCarga';
export default {
    data(){
        return {
            usuario: '',
            password: '',
            error: null,
            show1: false,
            imgData :this.$imgReporte,
            //secion
            login_:false,
            tipoMsj:'',
            msjError:'',
            activarError:false,
            carga : false
        }
    },
    components:{
            Mensaje,
            PantallaCarga
    },
    methods :{
        //SECION
        resultHijo(){
            this.login_ = false;
        },
        resultMsj(){
            this.activarError = false;
        },
        resultPantalla(){
            this.carga = false;
        },
        activarErrores(tipo,err,color){
            if(tipo == 1){
                this.login_ =true;
            }else{
                this.activarError=true;
                this.msjError = err;
                this.tipoMsj = color;
                setTimeout(this.resultMsj,6000);
            }
        },
            //FIN - SECION
        ingresar(){
            this.error=null;
            this.carga = true;
            axios.post('api/USUARIO_CLASS/Login', {usuario: this.usuario, password: this.password})
            .then(respuesta => {
                return respuesta.data
            })
            .then(data => {
                this.$store.dispatch("guardarToken", data.token)
                this.resultPantalla();
                //this.activarErrores(2,"Bienvenido.","green");
                this.$router.push({ name: 'home' });
            }).catch(err => {
              console.log(err);
                this.resultPantalla(); //Cierre de pantalla
                if (err.response.status==401){
                    this.activarErrores(1);
                }
                else if (err.response.status == 403){
                    this.activarErrores(2,"Error de permisos.","orange");
                }
                else if (err.response.status==404){
                    this.activarErrores(2,"No existe el usuario o sus datos son incorrectos.","red");
                }
                else{
                    this.activarErrores(2,err.response.data,"red");
                }
            });

        },
    }

}
</script>
